import { Component } from "react";

class MedicalPrescription extends Component {
  constructor(props) {
    super(props);
    this.state = {
      medicalPrescription: {
        orderKey: String,
        patient: {
          fullname: String,
          identificationNumber: String,
          medicineName: String,
        },
        smsPrice: Number,
        createdAt: String,
        smsState: String,
        smsResponseSentAt: String | null,
      },
    };
  }

  componentDidMount() {
    fetch(
      "/api/v1/orders/medical-prescriptions/1b9d6bcd-bbfd-4b2d-9b5d-ab8dfbbd4bed",
      {
        headers: new Headers({
          Authorization:
            "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJvcmRlcktleSI6IjFiOWQ2YmNkLWJiZmQtNGIyZC05YjVkLWFiOGRmYmJkNGJlZCIsImlhdCI6MTY2NjEyNzQ4MSwiZXhwIjoxNjY4NzE5NDgxLCJhdWQiOiJqd3Qtb3JkZXIta2V5In0.RrXOmFs6G7kcoPbau3nObQSrEmLuzk3wHHhtohjaH2U",
        }),
      }
    )
      .then((res) => res.json())
      .then((medicalPrescription) => {
        this.setState({ medicalPrescription: medicalPrescription });
      });
  }

  render() {
    return (
      <div className="App-header">
        <tr>
          <td className="App-link td">orderKey: </td>
          <td>{this.state.medicalPrescription.orderKey}</td>
        </tr>

        <tr>
          <td className="App-link td">fullname: </td>
          <td>{this.state.medicalPrescription.patient.fullname}</td>
        </tr>

        <tr>
          <td className="App-link td">identificationNumber: </td>
          <td>{this.state.medicalPrescription.patient.identificationNumber}</td>
        </tr>

        <tr>
          <td className="App-link td">medicineName: </td>
          <td>{this.state.medicalPrescription.patient.medicineName}</td>
        </tr>

        <tr>
          <td className="App-link td">smsPrice: </td>
          <td>{this.state.medicalPrescription.smsPrice}</td>
        </tr>

        <tr>
          <td className="App-link td">createdAt: </td>
          <td>{this.state.medicalPrescription.createdAt}</td>
        </tr>

        <tr>
          <td className="App-link td">smsState: </td>
          <td>{this.state.medicalPrescription.smsState}</td>
        </tr>

        <tr>
          <td className="App-link td">smsResponseSentAt: </td>
          <td>{this.state.medicalPrescription.smsResponseSentAt}</td>
        </tr>
      </div>
    );
  }
}

export default MedicalPrescription;
